import React, { useState } from 'react';
import axios from 'axios';

export default function PrediccionReserva() {
  const [formData, setFormData] = useState({
    numAdultos: 1,
    numNinos: 0,
    tipoHabitacion: 'Doble',
    precioHabitacion: 100.0,
    duracionEstadia: 3,
    diaSemanaCheckIn: 'friday',
    mesCheckIn: 4,
    antiguedadReserva: 15,
  });

  const [resultado, setResultado] = useState(null);
  const [confianza, setConfianza] = useState(null);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post('http://localhost:4040/api/prediccion/predecir', formData);
      console.log("Respuesta del backend:", res.data); // <--- Agrega esto

      setResultado(res.data.resultado);
      setConfianza(res.data.confianza);
    } catch (err) {
      console.error('Error en la predicci√≥n', err);
      setResultado('Error al conectar con el servidor.');
      setConfianza(null);
    }
  };

  return (
    <div className="max-w-2xl mx-auto p-6">
      <h1 className="text-2xl font-bold mb-6 text-center">üîç Predicci√≥n de Cancelaci√≥n de Reserva</h1>
      <form onSubmit={handleSubmit} className="space-y-4">

        <div>
          <label className="block mb-1 font-semibold">N√∫mero de Adultos</label>
          <input type="number" name="numAdultos" value={formData.numAdultos} onChange={handleChange} className="w-full p-2 border rounded" />
        </div>

        <div>
          <label className="block mb-1 font-semibold">N√∫mero de Ni√±os</label>
          <input type="number" name="numNinos" value={formData.numNinos} onChange={handleChange} className="w-full p-2 border rounded" />
        </div>

        <div>
          <label className="block mb-1 font-semibold">Tipo de Habitaci√≥n</label>
          <select name="tipoHabitacion" value={formData.tipoHabitacion} onChange={handleChange} className="w-full p-2 border rounded">
            <option value="Suite">Suite</option>
            <option value="Doble">Doble</option>
            <option value="Simple">Simple</option>
          </select>
        </div>

        <div>
          <label className="block mb-1 font-semibold">Precio de la Habitaci√≥n ($)</label>
          <input type="number" name="precioHabitacion" value={formData.precioHabitacion} onChange={handleChange} className="w-full p-2 border rounded" />
        </div>

        <div>
          <label className="block mb-1 font-semibold">Duraci√≥n de la Estad√≠a (d√≠as)</label>
          <input type="number" name="duracionEstadia" value={formData.duracionEstadia} onChange={handleChange} className="w-full p-2 border rounded" />
        </div>

        <div>
          <label className="block mb-1 font-semibold">D√≠a de la Semana del Check-in</label>
          <select name="diaSemanaCheckIn" value={formData.diaSemanaCheckIn} onChange={handleChange} className="w-full p-2 border rounded">
            <option>Monday</option>
            <option>Tuesday</option>
            <option>Wednesday</option>
            <option>Thursday</option>
            <option>Friday</option>
            <option>Saturday</option>
            <option>Sunday</option>
          </select>
        </div>

        <div>
          <label className="block mb-1 font-semibold">Mes del Check-in (1-12)</label>
          <input type="number" name="mesCheckIn" value={formData.mesCheckIn} onChange={handleChange} className="w-full p-2 border rounded" />
        </div>

        <div>
          <label className="block mb-1 font-semibold">Antig√ºedad de la Reserva (d√≠as)</label>
          <input type="number" name="antiguedadReserva" value={formData.antiguedadReserva} onChange={handleChange} className="w-full p-2 border rounded" />
        </div>

        <button type="submit" className="w-full bg-teal-700 hover:bg-teal-800 text-white py-2 rounded font-bold">
          Predecir
        </button>
      </form>

      {resultado && (
        <div className="mt-6 p-4 bg-gray-100 border rounded text-center">
          <h2 className="text-lg font-semibold">Resultado:</h2>
          <p className="mt-2 text-xl">
            {resultado === 'Si'
              ? '‚ùå La reserva probablemente ser√° cancelada'
              : '‚úÖ La reserva probablemente se mantendr√°'}
          </p>
          {confianza !== undefined && (
  <p className="mt-2 text-sm text-gray-600">Confianza: {(confianza * 100).toFixed(2)}%</p>
)}

        </div>
      )}
    </div>
  );
}
